import React, { useState } from 'react';

function Navbar({ onSectionChange }) {
    const [currentSection, setCurrentSection] = useState('home');

    const handleSectionChange = (section) => {
        setCurrentSection(section);
        onSectionChange(section);
    };

    return (
        <nav className="bg-white shadow-lg">
            <div className="max-w-7xl mx-auto px-4">
                <div className="flex justify-between h-16">
                    <div className="flex space-x-4 items-center">
                        {/* Your logo/brand here */}
                    </div>
                    <div className="flex space-x-4">
                        <button 
                            onClick={() => handleSectionChange('home')}
                            className={`px-4 py-2 rounded ${currentSection === 'home' ? 'bg-blue-500 text-white' : 'bg-gray-200'}`}
                        >
                            Home
                        </button>
                        <button 
                            onClick={() => handleSectionChange('about')}
                            className={`px-4 py-2 rounded ${currentSection === 'about' ? 'bg-blue-500 text-white' : 'bg-gray-200'}`}
                        >
                            About
                        </button>
                        <button 
                            onClick={() => handleSectionChange('team')}
                            className={`px-4 py-2 rounded ${currentSection === 'team' ? 'bg-blue-500 text-white' : 'bg-gray-200'}`}
                        >
                            Team
                        </button>
                        <button 
                            onClick={() => handleSectionChange('events')}
                            className={`px-4 py-2 rounded ${currentSection === 'events' ? 'bg-blue-500 text-white' : 'bg-gray-200'}`}
                        >
                            Activities
                        </button>
                        <button 
                            onClick={() => handleSectionChange('conuai')}
                            className={`px-4 py-2 rounded ${currentSection === 'conuai' ? 'bg-blue-500 text-white' : 'bg-gray-200'}`}
                        >
                            ConuAI
                        </button>
                        <button 
                            onClick={() => handleSectionChange('quantfund')}
                            className={`px-4 py-2 rounded ${currentSection === 'quantfund' ? 'bg-blue-500 text-white' : 'bg-gray-200'}`}
                        >
                            Quant Fund
                        </button>
                    </div>
                </div>
            </div>
        </nav>
    );
}

export default Navbar;
